import "./App.css";
import { BrowserRouter, Routes, Route } from "react-router-dom";
import Error from "./pages/Error";
import Signin from "./pages/auth/Signin";
import Logout from "./pages/auth/Logout";
import { PrivateRouteNew } from "./utils/PrivateRouteNew";
import HomeComponent from "./pages/HomeComponent";
import CompanyComponent from "./pages/CompanyComponent";
import CompanyDetailsComponent from "./pages/CompanyDetailsComponent";
import Config from "./utils/config";

function App() {
  return (
    <BrowserRouter>
      <Routes>
        <Route path="/" element={<Signin />} />
        <Route path="*" element={<Error />} />

        <Route path="/" element={<PrivateRouteNew activepage="0" render={(props) => ({ ...props })}  page={HomeComponent}  /> }>
          <Route path="/home" />
        </Route>

        <Route path="/" element={<PrivateRouteNew activepage="1" render={(props) => ({ ...props })} page={CompanyComponent}   />}>
        <Route path="/company"  />
        </Route>

        <Route path="/" element={<PrivateRouteNew activepage="1" render={(props) => ({ ...props })}  page={CompanyDetailsComponent}  />}>
        <Route path="/companydetails/:id"    />
        </Route>

        <Route path={Config.logoutPageUrl}element={<Logout />} />
      </Routes>
    </BrowserRouter>
  );
}

export default App;
